class FromToDivisibleDiv2:
    def shortest(self, N, S, T, a, b):
        q = []
        q.append((S, 0))
        existed = set()
        existed.add(S)

        idx = [1 for i in range(len(a))]

        while len(q) > 0:
            top = q[0]
            q = q[1:]
            for i in range(len(a)):
                if top[0] % a[i] == 0:
                    while idx[i] <= N / b[i]:
                        next_node = b[i] * idx[i]
                        if next_node == T:
                            return top[1] + 1
                        if next_node not in existed:
                            existed.add(next_node)
                            q.append((next_node, top[1] + 1))
                        idx[i] += 1

        return -1


