import sys
import time
def RunTest(testNum, p0, p1, p2, p3, p4, hasAnswer, p5):
    obj = FromToDivisibleDiv2()
    startTime = time.clock()
    answer = obj.shortest(p0, p1, p2, p3, p4)
    endTime = time.clock()
    testTime.append(endTime - startTime)
    res = True
    if hasAnswer:
        res = answer == p5
    if res:
        print(str("Test #") + str(testNum) + ": Passed")
        return res
    print(str("Test #") + str(testNum) + str(":"))
    print(("[") + str(p0) + str(",") + str(p1) + str(",") + str(p2) + str(",") + str(p3) + str(",") + str(p4) + str("]"))
    if (hasAnswer):
        print(str("Expected:"))
        print(str(p5))

    print(str("Received:"))
    print(str(answer))
    print(str("Verdict:"))
    if (not res):
        print(("Wrong answer!!"))
    elif ((endTime - startTime) >= 20):
        print(str("FAIL the timeout"))
        res = False
    elif (hasAnswer):
        print(str("OK!!"))
    else:
        print(str("OK, but is it right?"))
    print("Time: %.11f seconds" % (endTime - startTime))
    print(str("-----------------------------------------------------------"))
    return res

